import React from 'react';
import './App.css';
import ProductList from './components/ProductList.js';

function App() {
  return (
    <div className="app">
      <header className="header">My CMS</header>
      <div className="main">
        <nav className="sidebar">
          <ul>
            <li>Dashboard</li>
            <li>Products</li>
            <li>Settings</li>
          </ul>
        </nav>
        <main className="content">
          <h2>Product Management</h2>
          <ProductList />
        </main>
      </div>
    </div>
  );
}

export default App;
